text:
🍊 orange the world - stopp volden mot kvinner og jenter. tirsdag markerte vi den årlige "16 dager med aktivisme rettet mot kjønnsrelatert vold"-kampanje med et miniseminar. her ble det gjort status ett år etter #metoo og satt fokus på hva vi har lært så langt i kampen mot seksuell trakassering. 
seminaret ble arrangert i fellesskap med nordisk ministerråd, un women og unfpa og deltakerne var diplomater, forskere og representanter fra private organisasjoner som arbeider med emnet. les mer på vår facebook-side @norgesambassadecph
🍊
🍊
