text:
@michaelmolluramusic will be performing this saturday december 8th 2018 at 5pm at the mayme a. clayton museum & library in culver city for the #calnow equity awards 2018. primarily known as being the critically acclaimed composer for such award- winning feature films as: heal, awake: the life of yogananda, climate refugees, the highest pass, hare krishna and hbo's hot coffee. we are so pleased that he will be joining us for an intimate holiday performance. 
get your tickets 🎫 on #eventbrite or if you can’t make we will miss you but you can also donate by visiting www.calnow.org 
#calnow #genderequityawards2018 #naomigrossman #americanhorrorstory #ahsfx #feminism #genderequality #metoo ##womenempowerment #womensrights #yesallwomen #pressforprogress #humanrights #activism # love #feminist #heal #awake #hotcoffee

