i can now finally be released of staying as a silent victim.  biting my tongue, full of rage, playing nice to avoid your hot headed, sociopathic, degenerate impulses of trying to scam me, force me to take down my posts as you threatend me and then not giving a crap or any remorse for the shipping i am out of.  you threatened to damage my items if i did not do as you said.  you blackmailed me.  you are a disgusting human being and everything that comes your way based on your actions is on you. especially around christmas?  what have i ever done to you? i wonder who else you have scammed in the past? 
at least i can stand up and #metoo that.  faheem just noted he was scammed in march 2017 as well.  who else have you scammed?  i will never ever understand what a woman went through with #metoo and people have been in it a lot worse (losing their homes or savings) opposed to my $850 that you tried scamming...but i have a good (though slight in comparison) idea.  for that, i'm not staying silent. i want your daughter to grow up and read these comments on you down the road, on how you are a pos.  instagram won’t let me write more but have screenshots proof.  ty for reading everyone.

